好みの柄のバイアステープが簡単につくれます！<br>
袖ぐり・衿ぐりのパイピング始末やベルト通しなど、共布で素早く同じ幅のテープ作りができます。<br><br>

◆12mm幅<br>
◆P.サイズ：65×145×24mm<br><br>

※写真と実際の商品の色とは多少異なる場合があります。<br>

