パッチワークにあると便利なグッズ。<br>
マグネットピンクッションの上で針を放すと、磁力で針が同じ向きに並んでしっかりキャッチします。<br><br>

◆サイズ：幅120mm×長さ185mm×厚さ40mm<br>
◆重さ：225g<br>
◆セット内容：本体・マグネット式フタ・シルクマチ針（10本）<br><br>

